#include <climits>
#include <cmath>
#include <cstdio>
#include <iostream>
#include <vector>

using namespace std;

class Solution {
   private:
    pair<long long, long long> calcCumSumRange(vector<int>& diffs) {
        long long minVal = INT_MAX;
        long long maxVal = INT_MIN;

        long long crrSum = 0;
        for (int i = 0; i < diffs.size(); i++) {
            crrSum += diffs[i];

            minVal = min(minVal, crrSum);
            maxVal = max(maxVal, crrSum);
        }

        return {minVal, maxVal};
    }

   public:
    int numberOfArrays(vector<int>& differences, int lower, int upper) {
        long long availableRange = upper - lower;

        pair<long long, long long> sumRange = calcCumSumRange(differences);
        
        // actual range of numbers in hidden sequence would be either of
        // 1. diff b/w highest and least value of cumulative sum of differences (only when higest is positive and least is negative)
        long long actualRange = abs(sumRange.second - sumRange.first);
        // 2. (absolute value of) highest value of cumulative sum at any point
        actualRange = max(actualRange, abs(sumRange.first));
        // 3. (absolute value of) lowest value of cumulative sum at any point
        actualRange = max(actualRange, abs(sumRange.second));
        // 4. (absolution value of) max difference in original array
        long long maxDiffVal = *max_element(differences.begin(), differences.end());
        actualRange = max(actualRange, abs(maxDiffVal));
        // 5. (absolution value of) min difference in original array
        long long minDiffVal = *min_element(differences.begin(), differences.end());
        actualRange = max(actualRange, abs(minDiffVal));

        // printf("availableRange=%d, actualRange=%d, diff=%d\n", availableRange, actualRange, (availableRange - actualRange));

        if (actualRange > availableRange) {
            return 0;  // no solution possible
        } else {
            // if ranges are matching, then there's only 1 possible solution
            // if there's a leeway of 1, then there are 2 possible solutions;
            // therefore answer is diff + 1
            return (int)(abs(availableRange - actualRange) + 1);
        }
    }
};